  "terms_content": "<h2> PharmaLedger asociācijas elektroniskās produktu informācijas tīmekļa vietnes un lietojumprogrammas noteikumi un nosacījumi </h2><p>Piekļūstot PharmaLedger asociācijas elektroniskās produktu informācijas tīmekļa vietnei un lietojumprogrammai (\"Pakalpojumi\") vai izmantojot to, Jūs piekrītat ievērot šos noteikumus un nosacījumus (\"Noteikumi\"). Jūs nedrīkstat piekļūt Pakalpojumiem vai tos izmantot, ja nepiekrītat šiem Noteikumiem. Pakalpojumus pārvalda PharmaLedger asociācija (turpmāk tekstā - \"Asociācija\"), un tie ir paredzēti personām, kas meklē informāciju par saviem medikamentiem. Pakalpojumus nodrošina vairāku pušu tīkls, un Jūsu zāļu ražotājs piegādā informāciju par zālēm, kas tiek rādīta Pakalpojumos. Asociācija darbojas kā šīs informācijas datu pārzinis.</p><h2>Pakalpojumu lietošana </h2><p>Jūs piekrītat izmantot Pakalpojumus tikai likumīgiem mērķiem un tādā veidā, kas nepārkāpj nevienas trešās personas tiesības, neierobežo vai nekavē Pakalpojumu lietošanu un izmantošanu. Šādi ierobežojumi vai kavēšana cita starpā ietver rīcību, kas ir pretlikumīga vai kas var uzmācīgi ietekmēt vai radīt stresu vai neērtības kādai personai, kā arī nepieklājīga vai aizskaroša satura pārraidi vai normālas dialoga plūsmas traucēšanu Pakalpojumu ietvaros. </p><h2>Intelektuālais īpašums </h2><p>Pakalpojumu saturs, tostarp, bet ne tikai, teksts, grafika, attēli un programmatūra, ir Asociācijas vai tāslicences devēju un dalībsabiedrību īpašums, un to aizsargā autortiesības un citi intelektuālā īpašuma tiesību akti. Jūs nedrīkstatizmantot Pakalpojumu saturu jebkādiem komerciāliem mērķiem bez Asociācijas skaidras rakstiskas piekrišanas. </p><h2>Atbildība</h2><p> Asociācija nesniedz nekādus tiešus vai netiešus apliecinājumus vai garantijas par Pakalpojumu darbību vai Pakalpojumos iekļauto informāciju, saturu, materiāliem vai produktiem. Asociācija nav atbildīga par jebkāda veida zaudējumiem, kas radušies Pakalpojumu izmantošanas rezultātā, tostarp, bet ne tikai, par tiešiem, netiešiem, nejaušiem, soda un izrietošiem zaudējumiem. </p><h2>Pieņemtie tiesību akti </h2><p>Šos Noteikumus un Pakalpojumu izmantošanu reglamentē un interpretē saskaņā ar Šveices tiesību aktiem, un jebkādi strīdi tiks risināti Bāzeles tiesā, Šveicē. </p><h2>Noteikumu izmaiņas </h2><p>Asociācija patur tiesības jebkurā laikā mainīt šos Noteikumus, un Jūs esat atbildīgs par to, lai periodiski pārbaudītu, vai šajos Noteikumos nav veiktas izmaiņas. Turpinot izmantot Pakalpojumus pēc jebkādu izmaiņu veikšanas Noteikumos, Jūs piekrītat pārskatītajiem Noteikumiem. </p><p><br></p>",
