  "about_modal_title": "PharmaLedger",
  "about_content": "<h2>Par šo lietotni</h2><p>Šo lietotni Jums nodrošina PharmaLedger®. To kopīgi izstrādājušas pacientu pārstāvju organizācijas, farmācijas uzņēmumi un tehnoloģiju eksperti.</p><p>Tā ļauj lietotnes lietotājiem, skenējot svītrkodu uz zāļu iepakojuma, skatīt informāciju par zālēm.</p><p>Norādīto informāciju ir sniedzis produkta tirdzniecības atļaujas turētājs.</p><h2>Par PharmaLedger</h2><p>PharmaLedger® ir PharmaLedger asociācijas (PLA) zīmols.</p><p>PLA ir globāla bezpeļņas, neitrāla asociācija. Asociācijas mērķis ir izveidot un veicināt digitālās uzticības ekosistēmu veselības aprūpē.</p><p>Asociācija veicina sadarbību veselības aprūpes un biozinātņu nozarēs un sekmē inovācijas un to ieviešanu pacientu un citu ieinteresēto pušu interesēs.</p>",
  "help_modal_title": "Palīdzība",
  "help_modal_subtitle": "Biežāk uzdotie jautājumi",
  "help_content": "<div><p><b><h2>Kas ir EPI?</h2></b></p><p> <b>EPI</b> ir saīsinājums, kas apzīmē <b>elektronisko informāciju par produktu.</b> Tā ir produkta informācijas papīra lietošanas instrukcijas elektroniskā versija, kas parasti atrodas farmaceitiskā produkta iepakojumā. Dažos gadījumos <b>EPI</b> var būt aizstājusi papīra lietošanas instrukciju.</p><p><b><h2>Kas ir PharmaLedger?</h2></b></p><p>PharmaLedger asociācija (PLA) ir bezpeļņas asociācija, kas atrodas Šveicē un kuras mērķis ir nodrošināt un veicināt digitālās uzticamības ekosistēmu veselības aprūpē, izmantojot standartizētu un uzticamu pirmkoda platformu. PLA veicina sadarbību un paātrina inovācijas un to ieviešanu, lai pacientiem un citām ieinteresētajām personām panāktu abpusēju labumu veselības aprūpes un biozinātņu jomās. PLA tika izveidota 2022. gadā, lai turpinātu darbu pie PharmaLedger projekta, kas ir Eiropas Komisijas un farmācijas nozares finansēts trīs gadu projekts, kura mērķis ir pierādīt blokķēdes risinājumu vērtību. Plašāka informācija ir pieejama tīmekļa vietnē https://pharmaledger.org.</p><p><b><h2>Kas ir DataMatrix?</h2></b></p><p>Tas ir svītrkoda veids uz produkta iepakojuma. Tas ir melnbalts kvadrātveida svītrkods, un tas izskatās līdzīgi šim:<br><img src=\"./images/barcode_example.png\" alt='DataMatrix barcode example'></p><p><b><h2>Kā lietot lietotni? </h2></b></p><p>Sekojiet norādījumiem <b>lietotnes</b> mērķlapā... tajā ir attēlots, kur atrast <b>DataMatrix</b> uzJūsu produkta iepakojuma. Kad esat atradis <b>DataMatrix</b>, noklikšķiniet uz pogas <b>\"DataMatrix</b> skenēšana\". Ļaujietlietojumprogrammai izmantot kameru, lai varētu skenēt <b>DataMatrix</b>. Izmantojiet kameru, lai fokusētu uz <b>DataMatrix</b>. Kad zāļu iepakojums ir veiksmīgi noskenēts, tiks parādīta <b>EPI</b>. Varat noklikšķināt uz pogas , lai iegūtu sīkāku informāciju.</p><p><b><h2>Kāpēc mana DataMatrix skenēšana nedod rezultātu?</h2></b></p><p>Ir vairāki iemesli, kāpēc <b>DataMatrix uz</b> Jūsu zāļu iepakojuma var nesniegt EPI. Viens no iemesliem varētu būt kameras fokuss. Lūdzu, mēģiniet skenēt kodu labi apgaismotā vietā un tā, lai kods ekrānā būtu skaidri redzams. Ja Jums ir grūti noturēt roku nekustīgu, varat mēģināt roku atbalstīt uz galda.</p></div>",
